query machineModels {
  machineModels(tenantLinkType: NONE) {
    id
    technology
    modelName
    brand
    avatar
    isPublic
    externalId
    tenant {
      id
      name
      __typename
    }
    assignedApplicationVersions {
      id
      version
      application {
        id
        name
        __typename
      }
      __typename
    }
    __typename
  }
}
